import React from 'react';
import { Button, Typography } from '@mui/material';

const PickupPage = () => {
  return (
    <div style={{ textAlign: 'center', padding: '2rem' }}>
      <Typography variant="h4" gutterBottom>Pick-up Options</Typography>
      <div style={{ display: 'flex', justifyContent: 'center', gap: '1rem', marginTop: '2rem' }}>
        <Button variant="contained" sx={{ backgroundColor: "#4CAF50", color: '#FFFFFF', fontWeight: 'bold', width: '150px', height: '50px', fontSize: '16px', padding: '10px' }}>Order Now</Button>
        <Button variant="contained" sx={{ backgroundColor: "#FFA500", color: '#FFFFFF', fontWeight: 'bold', width: '150px', height: '50px', fontSize: '16px', padding: '10px' }}>View Menu</Button>
      </div>
      <div style={{ marginTop: '2rem' }}>
        <Typography variant="body1">- Place your order now and pick up later at your convenience.</Typography>
        <Typography variant="body1">- Browse our menu to see what we offer before placing your order.</Typography>
      </div>
    </div>
  );
};

export default PickupPage;
